import axios from "axios";

// export const recipe = axios
//   .get("http://localhost:3001/recipes/get")
//   .then((response) => {
//     return response.data;
//   });

export const recipe = fetch("http://localhost:3001/recipes/get")
  .then((response) => {
    response.json();
  })
  .then((data) => {
    return data;
  });
console.log(recipe);
